import React from "react";
import "../App.css";
import resume from "./KhyleCVJan23_23.pdf";


function Resume() {
    return (
        <div id="resume" className="RES">
            <h1 className="RESH">Resume</h1>
            <div className="flex-containerr">
                <div className="resume-list-container">
                    <ul>
                        <li>
                            <a href={resume} download>Download Resume</a>
                        </li>
                        <hr className="res-hr" />
                    </ul>
                </div>
            </div>
        </div>
    );
}

export default Resume;
